import React, { Component } from "react";
import { Form, Button } from "reactstrap";
import { GeneratorInput } from "./GeneratorInput";

class GeneratorForm extends Component {
  constructor() {
    super();
    this.state = {
      dataType: "integer",
      numCols: "",
      modalOptions: ""
    };
  }

  render() {
    return (
      <Form>
        <GeneratorInput />
        <GeneratorInput />
        <GeneratorInput />
        <FormGroup row>
          <Col md={3}>
            <Input
              type="select"
              name="datatype"
              id={`type-${this.props.id}`}
              onChange={e => this.setState({ dataType: e.target.value })}
            >
              <option value="integer">Integer</option>
              <option value="time-series">Time-Series</option>
              <option value="email">Email</option>
              <option value="phone">Phone Number</option>
            </Input>
          </Col>
          <Col md={3}>
            <Input
              type="number"
              name="numcols"
              id={`numcols-${this.props.id}`}
              onChange={e => this.setState({ numCols: e.target.value })}
            />
          </Col>
          <Col md={2}>
            <OptionsModal type={this.state.dataType} />
          </Col>
        </FormGroup>
        <Button type="submit" color="primary">
          Submit
        </Button>
      </Form>
    );
  }
}

export { GeneratorForm };
